import React from 'react';
import ReactDOM from 'react-dom';

function Card(props) {
  console.log(props);

  return (
    <div>
      <h2>{props.name}</h2>
      <img
        src={props.img}
        alt=""
      />
      <p>+123 456</p>
      <p>By@g.com</p>
    </div>
  );
}

ReactDOM.render(
  <div>
    <h1>My Contacts</h1>
    <Card
      name="Beyonce"
      img="https://c.files.bbci.co.uk/791C/production/_114240013_gettyimages-1253172998.jpg"
      tel="01234567"
      email="by@gmail"
    />
  </div>,

  document.getElementById('root')
);
